

import sys
target_file = sys.argv[1]
target = ""
bit0=""
bit1=""
bit2=""
bit3=""
bit4=""
bit5=""
bit6=""
bit7=""
n = 6144/8;
for i in range(int(n)):
	bit0 += target[0+i*8];
	bit1 += target[1+i*8];
	bit2 += target[2+i*8];
	bit3 += target[3+i*8];
	bit4 += target[4+i*8];
	bit5 += target[5+i*8];
	bit6 += target[6+i*8];
	bit7 += target[7+i*8];

f = open(target_file, 'w');
f.write(bit0+ "\n reuslt of bit 0 \n")
f.write(bit1+ "\n reuslt of bit 1 \n")
f.write(bit2+ "\n reuslt of bit 2 \n")
f.write(bit3+ "\n reuslt of bit 3 \n")
f.write(bit4+ "\n reuslt of bit 4 \n")
f.write(bit5+ "\n reuslt of bit 5 \n")
f.write(bit6+ "\n reuslt of bit 6 \n")
f.write(bit7+ "\n reuslt of bit 7 \n")
f.close()
print("DONE")